Welcome!

&quot;Good Vibes Only&quot; Metal Wall Art

Made with 14ga Steel, a &quot;marble&quot; grind pattern and metallic translucent powder coat 

Colors: (in order of pictures)
Blue Sparkle - transparent with sparkles
Candy Rose Gold - no sparkle or metallic flake, very glossy, transparent 
Gold Shimmer -  (light gold) transparent with sparkle
Coconut Sparkle - (dark bronze) (last 2) transparent with sparkle 

Actual sizes: 
12&quot; x 10.3&quot;
16.6&quot; x 15&quot;
20&quot; x 18.2&quot;
24&quot; x 21.8&quot;
28&quot; x 25.4&quot;

There are no mounting holes in this listing. We recommend you hang with damage free command strips. If you would like a few holes added, leave us a note at checkout

These items are handmade and may vary slightly - *this item is made with a plasma cutter and human hands* - there may be imperfections in the cut, grind or powder coating. Please keep that in mind when purchasing.
